create table ig_users
(
    name        varchar               not null
        constraint ig_users_pk
            primary key,
    friend      boolean default false not null,
    is_follower boolean default false not null,
    following   boolean default false not null
);

alter table ig_users
    owner to postgres;

create unique index ig_users_name_uindex
    on ig_users (name);

', false, true, false);
